import { useState } from 'react';

const OnlineJSCompiler = () => {
    const [code, setCode] = useState('');
    const [output, setOutput] = useState('');

    const handleRunCode = () => {
        try {
            // eslint-disable-next-line no-new-func
            const result = Function(`"use strict"; ${code}`)();
            setOutput(result?.toString() ?? '');
        } catch (err) {
            setOutput(err.toString());
        }
    };

    return (
        <div className="p-4 space-y-4">
            <h1 className="text-2xl font-bold">Online JavaScript Compiler</h1>
            <div className="p-4 border rounded-md">
                <textarea
                    className="w-full p-2 border rounded-md"
                    rows="8"
                    placeholder="Write your JavaScript code here..."
                    value={code}
                    onChange={(e) => setCode(e.target.value)}
                ></textarea>
                <button className="mt-2 px-4 py-2 bg-blue-500 text-white rounded-md" onClick={handleRunCode}>
                    Run Code
                </button>
            </div>
            <div className="p-4 border rounded-md">
                <h2 className="text-xl font-semibold">Output:</h2>
                <pre className="bg-gray-100 p-2 rounded-md whitespace-pre-wrap">
                    {output}
                </pre>
            </div>
        </div>
    );
};

export default OnlineJSCompiler;
